import React, {Component} from 'react';
import './App.css';

class Home_nav extends Component{
  render(){
    return(
      <header>
        <h1>Anfree</h1>
        <div>we want to free from anxity</div><br></br>
        <div>00:00</div>
      </header>
    );
  }
}

class Todo_list extends Component{
  render(){
    return(
      <input type="text" placeholder='add your anxity'></input>
    );
  }
}




function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Home_nav></Home_nav>
        <input type="text"></input>
      </header>
    </div>
  );
}

export default App;
